import SideBar from "../components/SideBar/Sidebar";
import MatchesCont from "../components/matches/MatchesCont";

const Matches = () => {
	return (
		<>
			<SideBar />
			<div className="text-black flex flex-col p-4 sm:ml-64">
				<MatchesCont status="ended" leagueTitle="Qatar World Cup" leagueIcon="https://media.api-sports.io/football/leagues/30.png"/>
			</div>
		</>
	);
};

export default Matches;
